import sys
import pprint as p

def exit():
  sys.exit(0)

def scramble(L):
  A = L
  i = 2
  while (i < len(A)):
    A[i-2] += A.pop(i-1)
    A[i-1].append(A[:i-2])
    i += 1
    p.pp(f'{L}')
    print()
    
  return L

def unscramble(L):
  A = L
  i = len(A) - 1

  while i >= 2:
    A[i-1].pop()
    A.insert(i-1, [A[i-2].pop()])
    i -= 1

  return L

def get_flag():
  flag = open('flag.txt', 'r').read()
  flag = flag.strip()
  hex_flag = []
  for c in flag:
    hex_flag.append([str(hex(ord(c)))])

  return hex_flag

